const ACTIONS = {
    SET_AVAILABLE_EFFECTS : "Set all availble current effects",


}
export {ACTIONS as EFFECTOR_ACTIONS }

export function setAvailableEffects(effects){
    return {
        type: ACTIONS.SET_AVAILABLE_EFFECTS,
        effects
    }
};
